};
class LoginForm extends React.Component{
    state = {
        data:{
            email:'',
            password:''
        },
        loading:false,
        errors:{}
    }
    render(){
        return(
            <form onSubmit = {this.onSubmit}>
                <label>Email</label>
                <input type='email' id = 'email' name='email'></input>
                <label>Password</label>
                <input 
                    type = 'password'
                    id = 'password'
                    name = 'password'
                >
                </input>
                <button type = "submit">Submit</button>
            </form>

        )
    }
}

export default LoginForm;
